import React from "react";
import "./style.css";
import { mainCards } from "./img/imgFunction";
import { Link } from "react-router-dom";


export default function WorksScreen() {

    return (
      <div className="works-screen">
        <Link className="image-cards">
          <div className="big-card">
            <img src={mainCards.budgetWebsite} alt="budgetWebsite" />
          </div>
          <div className="big-card">
            <img src={mainCards.cryptoWebsite} alt="cryptoWebsite" />
          </div>
          <div className="big-card">
            <img src={mainCards.recipeWebsite} alt="recipeWebsite" />
          </div>
          <div className="big-card">
            <img src={mainCards.portfolioWebsite} alt="portfolioWebsite" />
          </div>

          <div className="small-card"></div>
          <div className="small-card"></div>
          <div className="small-card"></div>
          <div className="small-card"></div>
        </Link>
      </div>
    );
}
